    getToday(): string {
        var someDate = new Date();

        var dd = someDate.getDate();
        var mm = someDate.getMonth() + 1; //January is 0!
        var yyyy = someDate.getFullYear();

        var strMM: string = mm.toString();
        var strDD: string = dd.toString();

        if (mm < 10) { strMM = '0' + mm.toString(); }
        if (dd < 10) { strDD = '0' + dd.toString(); }

        var today = yyyy + '-' + strMM + '-' + strDD;
        return today;

    }

    getDate(): string {
        var someDate = new Date();

        var dd = someDate.getDate();
        var mm = someDate.getMonth() + 1; //January is 0!
        var yyyy = someDate.getFullYear();

        var hour = someDate.getHours();
        var min = someDate.getMinutes();

        var strMM: string = mm.toString();
        var strDD: string = dd.toString();
        var strHour: string = hour.toString();
        var strMin: string = min.toString();

        if (mm < 10) { strMM = '0' + mm.toString(); }
        if (dd < 10) { strDD = '0' + dd.toString(); }
        if (hour < 10) { strHour = '0' + hour.toString(); }
        if (min < 10) { strMin = '0' + min.toString(); }

        //2017-12-20 00:00:00.000
        var today = yyyy + '-' + strMM + '-' + strDD + ' ' + strHour + ':' + strMin + ':00' ;
        return today;

    }

